setData();
function setData() {
    fetch(crv)
    .then(function(response) {
        if (response.status !== 200) {
            console.log(`Looks like there was a problem. Status code: ${response.status}`);
            return;
        }
        response.json().then(function(data) {

            console.log(data);
            data = JSON.parse(data);

            const node_num = document.getElementById("crv_node_num");
            node_num.innerText = data.num_node;

            const edge_num = document.getElementById("crv_edge_num");
            edge_num.innerText = data.num_edge;

            const scc_num = document.getElementById("crv_scc_num");
            scc_num.innerText = data.num_conn_comp;

            const lcc_num = document.getElementById("crv_lcc_num");
            lcc_num.innerText = data.largest_comp;

            const density = document.getElementById("crv_density_num");
            density.innerText = Math.round(data.density * 100000) / 100000;

            const triangles = document.getElementById("crv_triangle_num");
            triangles.innerText = data.triangles;

            const trans = document.getElementById("crv_trans");
            trans.innerText = Math.round(data.transitivity * 100000) / 100000;
        });
    })

    .catch(function(error) {
        console.log("Fetch error: " + error);
    });

}


